import {
  HideBetween,
  HideDuring,
  HideOn,
  HideScroll,
} from "react-hide-on-scroll";
import './App.css';

import Header from "./Components/Header";
import About from "./Components/About"

function App() {
  return (
    <div className="App">
      <HideDuring>
        <Header/>
      </HideDuring>
      <Header/>
      <About/>
    </div>
  );
}

export default App;
